Text:
@mrnexus.
You need to copy all the 3 .exe files from the crack folder over to the C:\Program Files\TeamViewer\Version6 and overwrite when asked.

And if running win 7 and your not able to overwrite the exe files, then you will need to stop the Teamviewer 6 Service, by going to start -> in the search type Services -> and then you should see services, click it -> then the services window should open -> search for TeamViewer 6, right click it and click Stop then you should be able to copy the 3 .exe files -> after your done copying, start the TeamViewer 6 service again.
